import React from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink, Navigate } from 'react-router-dom';
import './App.css';
import logo from './Color.png';
import { Helmet } from 'react-helmet';

import AboutUs from './AboutUs';
import LearnerSignIn from './LearnerSignIn';
import EducatorSignIn from './EducatorSignIn';
import ContactUs from './ContactUs';
import Home from './Home';
import EducatorSignUp from './EducatorSignUp';
import LearnerSignUp from './LearnerSignUp';
import LearnerSpace from './LearnerSpace';

// Importing MyComponen

function App() {
  return (
    <Router>
      <Helmet>
        <title>EduGate</title>
        <meta name="description" content="This is my React app" />
        <link rel="icon" href="/Color.png" type="image/x-icon" />
      </Helmet>

      <nav className="navbar">
        <div className="left">
          <NavLink to="/home">
            <img src={logo} width="200px" alt="logo" />
          </NavLink>
        </div>
        <div className="right">
          <ul className="list">
            <li>
              <NavLink to="/home" className={({ isActive }) => (isActive ? "active" : "")}>
                Home
              </NavLink>
            </li>
            <li>
              <NavLink to="/about-us" className={({ isActive }) => (isActive ? "active" : "")}>
                About Us
              </NavLink>
            </li>
            <li>
              <NavLink to="/learner-signin" className={({ isActive }) => (isActive ? "active" : "")}>
                Learner Login
              </NavLink>
            </li>
            <li>
              <NavLink to="/educator-signin" className={({ isActive }) => (isActive ? "active" : "")}>
                Educator Login
              </NavLink>
            </li>
            <li>
              <NavLink to="/contact-us" className={({ isActive }) => (isActive ? "active" : "")}>
                Contact Us
              </NavLink>
            </li>
          </ul>
        </div>
      </nav>

      <Routes>
        <Route path="/" element={<Navigate to="/home" replace />} />
        <Route path="/home" element={<Home />} />
        <Route path="/about-us" element={<AboutUs />} />
        <Route path="/learner-signin" element={<LearnerSignIn />} />
        <Route path="/educator-signin" element={<EducatorSignIn />} />
        <Route path="/contact-us" element={<ContactUs />} />
        <Route path="/educator-signup" element={<EducatorSignUp />} /> 
        <Route path="/learner-signup" element={<LearnerSignUp />} />
        <Route path="/learner-space" element={<LearnerSpace />} />
      </Routes>

      {/* Use MyComponent somewhere in your App component */}
      <MyComponent exampleProp="Example prop value" />
    </Router>
  );
}

// Define MyComponent class-based component
class MyComponent extends React.Component {
  constructor(props) {
      super(props);
      // Initialize component state here
      this.state = {
          exampleState: '',
      };
  }

  componentDidMount() {
      // Perform side effects (e.g., data fetching) here if necessary
  }

  render() {
      // Use state and props to render JSX elements
      const { exampleProp } = this.props;
      const { exampleState } = this.state;

      return (
          <div>
              <h1>My React Component</h1>
              <p>Prop value: {exampleProp}</p>
              <p>State value: {exampleState}</p>

              {/* Conditional rendering */}
              {exampleState ? <p>State is set!</p> : <p>State is not set.</p>}

              {/* Update state button */}
              <button onClick={() => this.setState({ exampleState: 'New Value' })}>
                  Update State
              </button>
          </div>
      );
  }
}

export default App;
